//     }
//     else{
//         res.status(404).send({msg: "Product Not Foundd"});
//     }
// });

// app.get("/api/products", (req, res) => {
    
//     res.send(data.products);
// });



app.listen(5432, () => {
    console.log("Server started at localhost:5432");
});

